package basic_003;
//write a java code to print odd numbers from 35 to 65
public class A009_forloop_odd_35_65 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i = 35; i <=65; i++) {
			if (i%2!=0) {
				System.out.println(i);
				
			}
			
			
		}

	}

}
